import '../C_dashboard/style_dashboard.css';
import React from 'react';
import icon_feed from '../icons';
import icon_search from '../icons';
import icon_upload from '../icons';


function NavBar(props) {
  
  return (    
    <div>
      <div id="home">
        
      </div>


      <h1>Actual navbar option: {props.menubar_option}</h1>
      {(() => {
        switch (props.menubar_option) {
          case "home":
            return <h1>Rendered navbar option: home</h1>;
            break;
          case "notifications":
            return <h1>Rendered navbar option: notifications</h1>;
            break;
          default:
            return <h1>Rendered navbar option: none</h1>;
        }
      })()}
    </div>  
  );
}

export default NavBar;
